import { useState } from 'react';
import { NavLink as RRNavLink, useNavigate } from 'react-router-dom';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    Button,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    Input,
    InputGroup,
    InputGroupText
} from 'reactstrap';
import {
    Search,
    List,
    Grid,
    BoxArrowInDownRight,
    Gift,
    Bookmark,
} from 'react-bootstrap-icons';  // Import appropriate icons

import Logo from '../assets/logo/recycle-world.png';

function NavBar(args) {
    const [isOpen, setIsOpen] = useState(false);
    const [searchQuery, setSearchQuery] = useState('');
    const navigate = useNavigate();

    const toggle = () => setIsOpen(!isOpen);

    // Handle search query submission
    const handleSearch = (e) => {
        e.preventDefault();
        if (searchQuery) {
            navigate(`/search?q=${searchQuery}`);
        }
    };

    return (
        <div>
            <Navbar {...args}>
                <NavbarBrand to="/" tag={RRNavLink}>
                    <img src={Logo} alt="logo" className="rounded" width="30" height="30" />
                </NavbarBrand>
                <NavbarToggler onClick={toggle} />

                <Collapse isOpen={isOpen} navbar>
                    <Nav className="me-auto">
                        {/* Alphabetical */}
                        <NavItem>
                            <NavLink className="link-light" tag={RRNavLink} to="/alphabetical">
                                <List className="m-1" size={20} />  {/* Alphabetical icon */}
                                Alphabetical
                            </NavLink>
                        </NavItem>

                        {/* Cheeses by Category (Dropdown) */}
                        <UncontrolledDropdown nav inNavbar>
                            <DropdownToggle nav caret className="link-light">
                                <Grid className="m-1" size={20} />  {/* Category icon */}
                                Cheeses by Category
                            </DropdownToggle>
                            <DropdownMenu>
                                <DropdownItem tag={RRNavLink} to="/category/type">
                                    Cheese By Type
                                </DropdownItem>
                                <DropdownItem tag={RRNavLink} to="/category/country">
                                    Cheese By Country
                                </DropdownItem>
                                <DropdownItem tag={RRNavLink} to="/category/milk">
                                    Cheese By Milk
                                </DropdownItem>
                                <DropdownItem tag={RRNavLink} to="/category/texture">
                                    Cheese By Texture
                                </DropdownItem>
                                <DropdownItem tag={RRNavLink} to="/category/color">
                                    Cheese By Color
                                </DropdownItem>
                            </DropdownMenu>
                        </UncontrolledDropdown>

                        {/* Vegetarian Cheeses */}
                        <NavItem>
                            <NavLink className="link-light" tag={RRNavLink} to="/vegetarian">
                                <Bookmark className="m-1" size={20} />  {/* Vegetarian icon */}
                                Vegetarian Cheeses
                            </NavLink>
                        </NavItem>

                        {/* Cheese Recipes */}
                        <NavItem>
                            <NavLink className="link-light" tag={RRNavLink} to="/recipes">
                                <BoxArrowInDownRight className="m-1" size={20} />  {/* Recipes icon */}
                                Cheese Recipes
                            </NavLink>
                        </NavItem>

                        {/* Cheese Gifts */}
                        <NavItem>
                            <NavLink className="link-light" tag={RRNavLink} to="/gifts">
                                <Gift className="m-1" size={20} />  {/* Gifts icon */}
                                Cheese Gifts
                            </NavLink>
                        </NavItem>
                    </Nav>

                    {/* Search bar */}
                    <form onSubmit={handleSearch} className="d-flex">
                        <InputGroup>
                            <Input
                                type="search"
                                value={searchQuery}
                                onChange={(e) => setSearchQuery(e.target.value)}
                                placeholder="Search Cheeses..."
                            />
                            <InputGroupText onClick={handleSearch} style={{ cursor: 'pointer' }}>
                                <Search />  {/* Search icon */}
                            </InputGroupText>
                        </InputGroup>
                    </form>
                </Collapse>
            </Navbar>
        </div>
    );
}

export default NavBar;
